import React, { useEffect, useState } from "react";
import { listBuildings } from "../../actions/buildingActions";
import { useSelector, useDispatch } from "react-redux";
import Loading from "../../components/Loading";
import ErrorMessage from "../../components/ErrorMessage";

function Test({history}){
 
    const dispatch = useDispatch();
    const buildingsList = useSelector((state) => state.cityList);
    const { loading, error, cities } = cityList;

    useEffect(() => {
        dispatch(listBuildings());
      }, [dispatch]);

    return(
        <div>
        { cities?.map(city => <p key={city._id}>{city.name}</p>)}
        <p>da</p>
        </div>
               
    )}

  export default Test;
